import React, {Component} from "react";
import OrganisationCard from "./OrganisationCard";

class OrganisationList extends Component {
render(){
    return(
        <div className="row">
           <OrganisationCard/>
           <OrganisationCard/>
           <OrganisationCard/>
           <OrganisationCard/>
           <OrganisationCard/>  <OrganisationCard/>
        </div>)
    }

}



export default OrganisationList;
